import React from 'react'
import {Navbar, Form, InputGroup, FormControl, Button} from 'react-bootstrap'

function NavbarToolbox() {
    return (
        <Navbar className="bg-danger justify-content-center">
            <Form inline>
                <FormControl type="text" style={{width: 200}} placeholder="Insert Text" className=" mr-sm-2" />
                <Button type="submit" style={{paddingInline: 35}}>Send</Button>
            </Form>
        </Navbar>
    )

}

export default NavbarToolbox
